import React from "react";
import * as ReactBootStrap from "react-bootstrap";


const Personalchecking=() =>{

    const url ="http://localhost:9090/personalchecking";

    return(
        <div>
        <header>
            <h1>Personal Checking Account</h1>
        <ReactBootStrap.Navbar
            collapseOnSelect
            expand="lg"
            bg="dark"
            variant="dark"
        >
            <ReactBootStrap.Navbar.Brand js-scroll-trigger a href="/deposit">
            Personal Checking Account Deposit
            </ReactBootStrap.Navbar.Brand>
            <ReactBootStrap.Nav.Link js-scroll-trigger a href="/transfer">
            Personal Checking Account Transfers
            </ReactBootStrap.Nav.Link>
           

        
         </ReactBootStrap.Navbar>
        </header>
        </div>


    )


}

export default Personalchecking;
